import {FaTimes} from 'react-icons/fa'


const Cv = ({tasks,deleteTask}) => {


  return (
    <>
      {
      tasks.map((task) => {
        return (

        <ul style={{display:'flex',alignItems:'center',gap:'15px'}}
        key={task.count}>{task.email}. {task.text} and {task.tel}.
        <FaTimes onClick={() =>deleteTask(task.count)}style={{color:'red'}} /> 
        </ul>

        )
      })}

    </>
  );
};

export default Cv;
